  margin-top: 20px;
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
`

export const HeaderContainer = styled.div`
  display: flex;
  width: 70%;

  ul {
    display: flex;
    flex-direction: column;
    list-style: none;

